import React, { Component } from 'react';
import './allVacations.css';

export default class AllVacations extends Component {

    render() {
        return (
            <div className="allVacationsSection">

                {/* All Vacations Section Header */}

                <h3 className="allVacationsHeader sharp-text">Displaying All Vacations
                    <svg viewBox="0 0 60 60" data-animoptions="{'duration':'1.5', 'repeat':'1', 'repeatDelay':'0'}" preserveAspectRatio="xMinYMin meet">
                    </svg>
                </h3>
            
                <div className="allVacations">

                </div>
            </div>
        )
    }
}
